import { connect } from "react-redux";
//import { fetchSingleStream, editStream } from "../../actions";
import _ from "lodash";
class TemplateEdit extends React.Component {
  componentDidMount() {
    //this.props.fetchSingleStream(this.props.match.params.id);
  }

  onSubmit = (fromValues) => {
    //this.props.editStream(this.props.match.params.id, fromValues);
  };
  render() {
    if (!this.props.stream) {
      return <div>Loading..</div>;
    }
    return (
      <div>
        <h3>Edit A Stream</h3>
      </div>
    );
  }
}
const mapStateToProps = (state, ownProps) => {
  const idOfStream = ownProps.match.params.id; // üzerinde islem yapılıcak olan streamin id si
  return { stream: state.streams[idOfStream] };
};
export default connect(
  mapStateToProps,
  {}
)(TemplateEdit);
